    const cnt = new Array(26).fill(0);

    for (const c of word) {
        cnt[c.charCodeAt(0) - 'a'.charCodeAt(0)]++;
    }

    cnt.sort((a, b) => a - b);
    let ans = Number.MAX_SAFE_INTEGER;
    let startDel = 0;

    for (let i = 0; i < 26; i++) {
        let curDel = startDel;
        const topLimit = cnt[i] + k;
        for (let j = i + 1; j < 26; j++) {
            if (topLimit < cnt[j]) {
                curDel += cnt[j] - topLimit;
            }
        }
        ans = Math.min(ans, curDel);
        startDel += cnt[i];
